  <div class='question'>
    <form>
    <label>
      Question:<br/>
      <textarea type="text" rows='20' cols='70'/>
      <textarea type="text" name="name" rows='20' cols='70'/><br/>
      <input type="submit" value="Submit" />
    </label>
    </form>
  </div>

}

function App() {
  return (
    <button onClick='addQuestion()'></button>
  );
}

export default App;
